import React, {Component} from 'react';

class HeaderTop extends Component {
    render() {
        return (
            <div className="header-top wrapper">
                <i className="far fa-envelope"></i>
                <p>info@domain.com</p>
                <p>+12344567</p>
            </div>
        );
    }
}

export default HeaderTop;
